sources.sass\\_section-teacher.scss:
.section.teacher {
  padding-top: 0;
  padding-bottom: 50px;
  @media screen and (min-width: $desktop) {
    padding-bottom: 130px;
  }
}

.teacher.title {
  margin-bottom: 20px;
  text-align: left;

  @media screen and (min-width: $tablet) {
    margin-bottom: 30px;
    font-size: 26px;
  }

  @media screen and (min-width: $desktop) {
    margin-bottom: 50px;
    font-size: 46px;
  }
}
.teacher-wrap {
  @media screen and (min-width: $tablet) {
    display: flex;
  }
  @media screen and (min-width: $desktop) {
    width: 1205px;
  }
}

.teacher-photo {
  max-width: none;
}
.teacher-achievment-box {
  @media screen and (min-width: $tablet) {
    margin-left: 40px;
  }
  @media screen and (min-width: $desktop) {
    margin-left: 30px;
  }
}
.teacher-name {
  margin-bottom: 10px;
  font-weight: 800;
  font-size: 20px;
  line-height: 1.2;
  letter-spacing: 0.08em;

  color: $title-text-color;

  @media screen and (max-width: $tablet - 1) {
    margin-top: 20px;
  }
  @media screen and (min-width: $desktop) {
    margin-bottom: 15px;
    font-size: 30px;
  }
}
.teacher-achievment.list {
  padding-top: 20px;
  border-top: 1px solid $primary-text-color;
}

.teacher-achievment.item {
  position: relative;
  padding-left: 26px;
  font-weight: 600;
  font-size: 14px;
  line-height: 1.214;
  letter-spacing: 0.06em;

  color: $title-text-color;

  &:not(:last-child) {
    margin-bottom: 20px;
    @media screen and (min-width: $desktop) {
      margin-bottom: 30px;
    }
  }
  @media screen and (min-width: $desktop) {
    padding-left: 59px;
    font-size: 16px;
    line-height: 1.25;
  }
}
.teacher-achievment.item::before {
  content: '';
  position: absolute;
  top: 0;
  left: 0;
  display: inline-block;
  width: 17px;
  height: 14px;
  background-repeat: no-repeat;
  background-size: contain;
  background-image: url(../images/icon-check.svg);

  @media screen and (min-width: $desktop) {
    width: 24px;
    height: 20px;
  }
}
.decorate-line:before {
  content: '';
  display: block;
  margin: 15px 0;
  width: 20px;
  height: 2px;
  background-color: $accent-color;

  @media screen and (min-width: $desktop) {
    margin: 30px 0;
  }
}

.teacher-achievment.desc {
  margin-bottom: 15px;
  font-weight: 500;
  font-size: 12px;
  line-height: 1.667;

  color: $primary-text-color;

  @media screen and (min-width: $desktop) {
    font-size: 18px;
    line-height: 1.556;
  }

  &:last-of-type {
    margin-bottom: 10px;

    @media screen and (min-width: $desktop) {
      margin-bottom: 20px;
    }
  }
}
.certificate {
  margin: 0;
  padding: 0;
  border: none;
  font-weight: 500;
  font-size: 12px;
  line-height: 1.667;
  text-decoration-line: underline;
  background-color: transparent;

  color: $accent-color;
  @media screen and (min-width: $desktop) {
    font-size: 18px;
    line-height: 1.556;
  }
}

sources.sass\\_section-we-ensure.scss:
.we-ensure .title {
  margin-top: 0;
  margin-bottom: 30px;
  font-size: 26px;

  @media screen and (min-width: $desktop) {
    font-size: 46px;
    margin-bottom: 50px;
  }
}

.we-ensure-wrap {
  @media screen and (max-width: $tablet - 1) {
    background-color: #f1f1f1;
  }
}
.we-ensure-box {
  padding-top: 30px;
  padding-bottom: 30px;
  @media screen and (min-width: $tablet) {
    padding-left: 79px;
    padding-right: 50px;
    background-color: #f1f1f1;
  }

  @media screen and (min-width: $desktop) {
    padding-top: 50px;
    padding-bottom: 45px;
    padding-left: 112px;
    padding-right: 112px;
  }
}

.line-dashed .item:not(:last-child) {
  border-left: 1px dashed $primary-text-color;
}
.we-ensure .item {
  position: relative;
  padding-left: 28px;
  font-weight: 500;
  font-size: 12px;
  line-height: 1.667;

  color: #3d3d3d;
  span {
    color: $accent-color;
  }
  &:not(:last-child) {
    padding-bottom: 23px;
  }

  @media screen and (min-width: $tablet) {
    padding-left: 32px;
    &:not(:last-child) {
      padding-bottom: 20px;
    }
  }
  @media screen and (min-width: $desktop) {
    padding-left: 41px;
    font-size: 20px;
    line-height: 1.4;
  }
}

.item.star::after {
  content: '*';
  color: $accent-color;
}
.we-ensure.item::before {
  content: ' ';
  position: absolute;
  top: 0;
  left: 0;
  transform: translateX(-50%);
  display: inline-block;
  width: 15px;
  height: 20px;
  background-repeat: no-repeat;
  background-size: contain;
  background-image: url(../images/campfire.svg);

  @media screen and (min-width: $desktop) {
    width: 22px;
    height: 30px;
  }
}

sources.sass\\_section-reviews.scss:
.icon {
    fill: currentColor;
    transition: background-color $timing-function;
}

.social-link {
    display: flex;
    align-items: center;
    justify-content: center;
    margin-left: auto;
    margin-right: auto;
    width: 44px;
    height: 44px;
    border-radius: 50%;
    background-repeat: no-repeat;
    background-position: center;
    color: blueviolet;
    transform: scale(1);
    transition: transform $timing-function;
}

.social-link:hover,
.social-link:focus {
    background-color: rgb(14, 147, 151);
    color: $white-color;
    transform: scale(1.25);
    animation: change-color 1000ms $timing-function;
}

@keyframes change-color {
    0% {
        background-color: rgb(80, 157, 177);
    }
    50% {
        background-color: aquamarine;
    }
    100% {
        background-color: aqua;
    }
}

.card-senior {
    padding: 20px 20px 30px 20px;
    text-align: center;
}

.name-senior {
    margin-top: 30px;
    margin-bottom: 10px;
    font-weight: 800;
    font-size: 14px;
    line-height: 1.21;
    text-align: center;
    letter-spacing: 0.08em;
    color: $accent-color;
}

.comment {
    margin-top: 10px;
    margin-bottom: 30px;
    color: $secondary-text-color;
}

a.extra {
    color: $accent-color;
    text-decoration: underline;
}

sources.sass\\_footer.scss:
.footer {
